import React from 'react';
import {
  Layout,
} from 'antd';
import RightNavigation from './right-navigation.component';
import './navigation.styles.css';

const { Header } = Layout;
const Navigation = () => (
  <Header className="header" style={{ marginBottom: '20px' }}>
    <div className="logo" />
    <RightNavigation />
  </Header>
);

export default Navigation;
